import React from "react";

class Header extends React.Component{
    render() {
        return(
            <div class="container">
            <header class="header" id="header">
                <div id="logo"><a href = "index.html"><img src="https://brave-pebble-0432f1103.2.azurestaticapps.net/src/logo.svg" /> </a></div>
                <div id="quick_link">
                    <a target="_blank" href = "https://www.google.com/maps/place/Worldofboardgames.com/@63.8482097,20.3114261,15z/data=!4m2!3m1!1s0x0:0xc047bbd27173880b?sa=X&ved=2ahUKEwjF4LnVm6T9AhXL6CoKHWpSAYYQ_BJ6BAhxEAg"><i class="map"><img src="https://cdn-icons-png.flaticon.com/512/5767/5767387.png" alt="hitta till butiken" /></i></a>
                    <a href = "login.html"><i class="knight"><img src="https://cdn-icons-png.flaticon.com/512/3819/3819346.png" alt="logga in eller skapa konto" /></i></a>
                    <a href = "URL"><i class="cart"><img src="https://cdn-icons-png.flaticon.com/512/833/833314.png" alt="din kundvagn" /></i></a>
                    <a href="#footer"><i class="down"><img src="https://cdn-icons-png.flaticon.com/512/2985/2985149.png" alt="button to footer" /></i></a>
                </div>
            </header>
            </div>
        );
    }
}
export default Header;
